我们写一个fan.c的程序，该程序用于控制树莓派的GPIO 14。 #include <wiringPi.h>
#include <signal.h> #define Fan 14 int isLoop = 1; void breakLoop(int signal) { isloop = 0;
} int main(void) { signal(SIGINT, breakLoop); signal(SIGTERM, breakLoop); signal(SIGHUP, breakLoop); wiringPiSetupGpio(); pinMode(Fan, OUTPUT); digitalWrite(Fan, HIGH); while (isloop); digitalWrite(Fan, LOW); pinMode(Fan, INPUT); return 0;
} 编译代码： gcc -Wall fan.c -lwiringPi -o fan 执行代码： ./fan
